(104665, 2536, '.2470.2472', 'Chalatas SZL-041 raudonas', 'chalatas szl-041 raudonas', 'Chalatas-SZL-041-raudonas', '', '<html><head></head><body><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;">Ryškiai raudonas, minkštas ilgas chalatas. Su dailia apykakle, kuri suteikia elegancijos ir puošnumo.</p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;">Rankovės ilgos, gali būti užraitomos, prisitaikant reikiamą ilgį. Su diržu ir kilpute pakabinti.</p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;"> </p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;">Pasiūtas iš itin minkšto audinio(tankis 280-300g/m2),turinčio priešgrybelinių, antibakterinių savybių. Ši medžiaga puikiai laiko kūno šilumą.</p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;"><span style="text-decoration:underline;font-weight:bold;"> </span></p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;"><span style="text-decoration:none;font-weight:bold;">Dydžiai:</span></p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;">S/M (klubų apimtis 82-90 cm)</p><p class="msonormal" style="margin-right:0cm;margin-bottom:0pt;margin-left:0cm;margin-top:0cm;">L/XL (klubų apimtis 90-98 cm)</p><p><span mso-bidi-font-size="10.5pt"> </span></p><p> </p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-12-10 11:15:11', 0, NULL, '250920000007', 'vnt.', 932, 0, '2012-11-29', 0, 0, 0, 0, 0),
(104667, 2535, '.2470.2471', 'Rankšluostis WATERSIDE (50x100 cm)', 'ranksluostis waterside (50x100 cm)', 'Ranksluostis-WATERSIDE-50x100-cm-', '', '<DIV class=photocaption_text>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="COLOR: black; mso-bidi-font-size: 12.0pt">"HAMAM" firmos rankšluosčiai skirti pirties bei SPA procedūroms. <BR>Itin aukšta kokybė, dvasinio apsivalymo pojūtis ir 2000 metų atgal siekiančios turkų, suomių, japonų, rusų ir romėnų pirties tradicijos. <BR style="mso-special-character: line-break"><BR style="mso-special-character: line-break"><o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="COLOR: black; mso-bidi-font-size: 12.0pt"><o:p>&nbsp;</o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-AUTOSPACE: ideograph-numeric; mso-layout-grid-align: auto; punctuation-wrap: hanging; mso-line-height-alt: 11.25pt; mso-vertical-align-alt: auto"><SPAN style="mso-bidi-font-size: 12.0pt; mso-fareast-language: LT">Rankšluostis įpakuotas antibakterinėje pakuotėje, kurios užsegimas yra apsaugotas gamintojo plomba, užtikrinančia, kad pakuotėje kokybiškas, orginalus ir nei karto nenaudotas produktas.</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-AUTOSPACE: ideograph-numeric; mso-layout-grid-align: auto; punctuation-wrap: hanging; mso-line-height-alt: 11.25pt; mso-vertical-align-alt: auto"><SPAN style="mso-bidi-font-size: 12.0pt; mso-fareast-language: LT"></SPAN>&nbsp;</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-AUTOSPACE: ideograph-numeric; mso-layout-grid-align: auto; punctuation-wrap: hanging; mso-line-height-alt: 11.25pt; mso-vertical-align-alt: auto"><SPAN style="mso-bidi-font-size: 12.0pt; mso-fareast-language: LT"><U><STRONG>Spalva:</STRONG></U></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-AUTOSPACE: ideograph-numeric; mso-layout-grid-align: auto; punctuation-wrap: hanging; mso-line-height-alt: 11.25pt; mso-vertical-align-alt: auto">