(111745, 2645, '.2470.2571.2578.2581', 'Šortukai Kola set', 'sortukai kola set', 'Sortukai-Kola-set', '', '<P>Šortukai&nbsp;Kola set&nbsp;itin patogus komplektas, kuris išmargintas skirtingo dydžio figūromis.&nbsp;Komplektą sudaro liemenėlė sutvirtinta lankeliais, kad krūtinė atrodytų gražiau ir šortukų tipo kelnaitės.&nbsp;Visas komplektėlis pasiūtas iš medvilninės medžiagos, leidžiančioms Jums puikiai jaustis, o Jūsų kūnui laisvai kvėpuoti. Šis komplektėlis puikiai tiks patogumo ir paprastumo gerbėjoms. </P>\r\n<P style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto" class=MsoNormal align=left><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN></P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-outline-level: 2" class=MsoNormal><B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><U>Liemenėlių&nbsp;dydžių lentelė:</U></SPAN></B></SPAN></P>\r\n<P>\r\n<TABLE border=0>\r\n<TBODY>\r\n<TR>\r\n<TH>Liemenėlės dydis</TH>\r\n<TH>Krūtinės apimtis, cm.</TH>\r\n<TH>Apimtis po krūtine, cm.</TH></TR>\r\n<TR>\r\n<TD>\r\n<P align=center>70A</P></TD>\r\n<TD>\r\n<P align=center>82-84</P></TD>\r\n<TD>\r\n<P align=center>68-72</P></TD></TR>\r\n<TR>\r\n<TD>\r\n<P align=center>70B</P></TD>\r\n<TD>\r\n<P align=center>84-86</P></TD>\r\n<TD>\r\n<P align=center>68-72</P></TD></TR>\r\n<TR>\r\n<TD>\r\n<P align=center>70C</P></TD>\r\n<TD>\r\n<P align=center>86-88</P></TD>\r\n<TD>\r\n<P align=center>68-72</P></TD></TR>\r\n<TR>\r\n<TD>\r\n<P align=center>70D</P></TD>\r\n<TD>\r\n<P align=center>88-90</P></TD>\r\n<TD>\r\n<P align=center>68-72</P></TD></TR>\