(111802, 2643, '.2470.2571.2578.2579', 'String Diamond set', 'string diamond set', 'String-Diamond-set', '', '<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P>String Diamond set yra dviejų dalių komplektėlis. Pasiūtas iš blizgios ir&nbsp;švelnios kūnui medžiagos. Puošnus ir prabangus. <EM>Stringų </EM>tipo kelnaitės ir daili nugaroje susegama liemenėlė. Kaušeliai pakietinti ir sutvirtinti lankeliais, padidina bei iškelia krūtinę. Petnešėlės nusegamos. Kelnaitės ir liemenėlė papuošti dideliu kaspinu ir Svarovskio kristaliukais. Subtiliai ir žinančiai, ko nori, moteriai, apsivilk ir kiekvieną dieną atrodyk kaip karalienė.</SPAN></P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;70B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: a