(111869, 2643, '.2470.2571.2578.2579', 'String Šeri set', 'string seri set', 'String-Seri-set', '', '<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">String Šeri set yra dviejų dalių komlektėlis, kuris keri savo sodria spalva, padailintas ornamentais, nėriniais ir mažu kaspinėliu. Liemenėlės petnešėlės gražiai padailintos tamsiais nėriniais kaip ir stringų tipo kelnaičių galinė dalis. Kaušeliai pakietinti ir sutvirtinti lankeliais, kad krūtinė atrodytų kuo tobuliau.&nbsp;Liemenėlė susegama nugaroje. Jei patinka mėlyna spalva ir nėriniai, vadinasi, šis nuostabus komplektėlis skirtas Tau.</P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN></U></B></SPAN>&nbsp;</P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P></SPAN>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;70B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S&nbsp;&nbsp;</SPAN></P>\r\n<P class=MsoNormal style="MARG