(111913, 2643, '.2470.2571.2578.2579', 'String-tanga Decor set', 'string-tanga decor set', 'String-tanga-Decor-set', '', '<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P>String - tanga Decor set susideda iš PUSH-UP liemenėlė + tanga arba string kelnaitėmis. Tai elegantiškas ir subtilus dviejų dalių komplektėlis, išsiuvinėtas ir padailintas žaviais nėrinukais. Priekyje papuoštas mažais kaspinėliais su baltu karoliuku. Liemenėlės petnešėlės nusegamos. Kaušeliai pakietinti ir sutvirtinti lankeliais, Push up tipo. Susegama nugaroje. Kelnaitės tanga arba string stiliaus, dalis jų pasiūta iš permatomo tiulio. Komplektėlis puikiai priglunda prie kūno ir&nbsp;nevaržo judesių.</P>\r\n<P><!--\r\n@page { margin: 2cm }\r\nP { margin-bottom: 0.21cm }\r\n--></P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P></SPAN>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;75B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S string&nbsp;&nbsp;</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-m