(111956, 2643, '.2470.2571.2578.2579', 'String-tanga Star set', 'string-tanga star set', 'String-tanga-Star-set', '', '<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P>String - tanga Star set yra sodrios spalvos komplektėlis, kurį sudaro susegama priekyje, dailiai išsiuvinėta, su nusegamom petnešėlėmis liemenėlė ir tanga arba string tipo kelnaitės dailiai išsiuvinėtos, puoštos mažais kaspinėliais ir nėrinukais. Priekinė kelnaičių dalis pasiūta iš permatomo tiulio. Dailiai priglunda prie kūno, nevaržo judesių. Jei patinka ryškios spalvos, šis komplektėlis patiks.</P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN>&nbsp;</P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P><!--\r\n@page { margin: 2cm }\r\nP { margin-bottom: 0.21cm }\r\n--></P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P></SPAN>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;75A&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;M string&nbsp;&nbsp;</SPAN></P>\r