(111974, 2643, '.2470.2571.2578.2579', 'String Gazette 114 set', 'string gazette 114 set', 'String-Gazette-114-set', '', '<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P>String Gazette 114 set tai nuotaikingas, įvairiomis raidėms ir žodžiais išmargintas komplektėlis. Jį sudaro krūtinę pakelianti&nbsp;liemenėlė ir <EM>stringų</EM> tipo kelnaitės. Komplektėlis pasiūtas iš ypač malonios prisiliesti&nbsp;medžiagos. Petnešėlės nusegamos. Kaušeliai pakietinti ir sutvirtinti lankeliais, kad krūtinė atrodytų kuo dailiau. Liemenėlė susegama nugaroje. Jei negali atsispirti nuotaikingiems ir patogiems drabužėliams, vadinasi, šis komplektėlis skirtas būtent Tau.</P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN></U></B></SPAN>&nbsp;</P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P></SPAN>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;70B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S&nbsp