(111978, 2646, '.2470.2571.2578.2582', 'Korsetas Sweatheart', 'korsetas sweatheart', 'Korsetas-Sweatheart', '', '<P>Korsetas Sweatheart yra dailus, ypač seksualus, kūno formas pabrėžiantis dviejų dalių komplektukas. Viršutiniąją dalį sudaro apačioje dailiai išsiuvinėtas korsetukas su nusegamomis petnešėlėmis. Kaušeliai pakietinti, kad krūtinė atrodytų gerokai įspūdingiau. Liemens srityje komplektukas papuoštas dailiu šilko kaspinėliu. Prie korsetuko galima prisegti kojines. Apatinioji dalis dailios <EM>stringų</EM> tipo kelnaitės. Vilkėdama jį&nbsp;kiekvieną naktį jauskis ypatinga.</P>\r\n<P>&nbsp;</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;75B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S&nbsp;&nbsp;</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language