(111980, 2646, '.2470.2571.2578.2582', 'Korsetas Venecija', 'korsetas venecija', 'Korsetas-Venecija', '', '<P>Korsetas Venecija itin dailus dviejų dalių komplektėlis: korsetėlis ir tanga tipo kelnaitės. Prabangios išvaizdos jam suteikia aukiniais siūlais agražinti elegantiški ir kerintys nėriniai. Komplektėlis pasiūtas iš permatomo tiulio maloniai ir gražiai priglundančio prie kūno. Korsetėlio petnešėlės nusegamos, kaušeliai pakietinti ir sutvirtinti lankeliais. Korsetas turi juostelės prisegamoms kojinėms.</P>\r\n<P>&nbsp;</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P>\r\n<P>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;70B&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;S&nbsp;&nbsp;</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;70C&nbsp;&nbsp;&nbsp;&nbsp;&