(112000, 2644, '.2470.2571.2578.2580', 'Tanga-string Ksara set', 'tanga-string ksara set', 'Tanga-string-Ksara-set', '', '<P>Tanga - string Ksara set pagaminta iš malonios kūnui medžiagos skoningai išsiuvinėtas komplektukas. Liemenėlės kaušeliai sutvirtinti lankeliais,&nbsp;kad krūtinė atrodytų tobulai,&nbsp;pagalvėlės išimamos, pati susegama nugaroje. Petnešėlės per vidurį permatomos, banguotais krašteliais. Liemenėlę puošia mažas kaspinėlis. Kelnaitės <EM>tanga arba string </EM>tipo. Priekinė&nbsp;dalis pasiūta iš permatomos medžiagos, krašteliai dailiai apsiuvinėti. Šis komplektėlis puikiai priglunda prie kūno, gražiai atrodo, nevaržo judesių. </P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN></U></B>&nbsp;</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN>&nbsp;<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><U><STRONG>Liemenėlė:</STRONG></U>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<U> <STRONG>Kelnaitės:</STRONG></U></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">75A&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbs