(112369, 2636, '.2470.2571.2572', 'Liemenėlė Šachmatinė', 'liemenele sachmatine', 'Liemenele-Sachmatine', '', '<SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">\r\n<P>Liemenėlė Šachmatinė tai išmarginta juodai baltais smulkiais kvardačiukais medvilninė liemenėlė. Padailinta švelnios rožinės spalvos juostelėmis ir kaspinėliu. Petnešėlės nusegamos. Kaušeliai šiek tiek pakietinti is sutvirtinti lankeliais. Susegama nugaroje. Pasiūta iš malonios kūnui medžiagos oda kvėpuos, o tu jausiesi puikiai net karštą vasaros dieną.</P></SPAN>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN>&nbsp;</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi liemenėlių dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:</SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p></o:p></SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;75A</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 75B</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; mso-margin-top-alt: auto; mso-margin-bottom-alt: auto"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 75C</SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm