(112386, 2651, '.2470.2571.2587', 'Naktinukai Amelia', 'naktinukai amelia', 'Naktinukai-Amelia', '', '<P>Naktinukai Amelia tai sodriai raudonos spalvos seksuali mini suknelė. Tampri medžiaga gražiai išryškins Jūsų kūno subtilumus. Atvira nugara, rašteliai užrišami už nugaros. Suknelė komplektuojama su string tipo kelnaitėmis. Komplektas elegantiškame įpakavime. </P>\r\n<P>&nbsp;</P>\r\n<P><STRONG><U>Galimi naktinukų dydžiai:</U></STRONG></P>\r\n<P><STRONG>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S/M</STRONG></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><STRONG>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; L/XL</STRONG></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><STRONG></STRONG></SPAN>&nbsp;</P>\r\n<P>Dydis S/M atitinka šiuos išmatavimus: 81-91cm krūtinės apimtis, B/C kaušelis, 56-71cm liemuo, 86-97cm klubai. </P>\r\n<P>Dydis L/XL atitinka šiuos išmatavimus: 91-107cm krūtinės apimtis, C/D kaušelis, 71-91cm liemuo, 97-112cm klubai. </P>\r\n<P>&nbsp;</P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, '', '2011-09-12 13:44:03', 0, NULL, '250975000011', 'vnt.', 176, 1, '2012-11-29', 0, 0, 0, 0, 0);
