(112429, 2651, '.2470.2571.2587', 'Naktinukai Sheila', 'naktinukai sheila', 'Naktinukai-Sheila', '', '<P>Naktinukai Sheila tai prabangiai atrodantis ir puošnus komplektėlis, kurį sudaro marškinukai ant petnešėlių ir stringų tipo kelnaitės. Marškinukų petnešėlės puoštos perliukų imitacijos karoliukais, krūtinės srityje prisiūta širdies formos papuošimas. Neįprastas pasiuvimas ir sidarbro spalvos juosta suteikia komplektėliui dar daugiau žavesio. Skirtas prabangą ir originalų dizainą dievinančiai moteriškos giminės atstovei... </P>\r\n<P>&nbsp;</P>\r\n<P><STRONG><U>Galimi naktinukų dydžiai:</U></STRONG></P>\r\n<P><STRONG>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S/M</STRONG></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><STRONG>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; L/XL</STRONG></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><STRONG></STRONG></SPAN>&nbsp;</P>\r\n<P>Dydis S/M atitinka šiuos išmatavimus: 81-91cm krūtinės apimtis, B/C kaušelis, 56-71cm liemuo, 86-97cm klubai. </P>\r\n<P>Dydis L/XL atitinka šiuos išmatavimus: 91-107cm krūtinės apimtis, C/D kaušelis, 71-91cm liemuo, 97-112cm klubai. </P>\r\n<P>&nbsp;</P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Beauty Night Fashion', '2011-09-13 09:49:49', 0, NULL, '250975000051', 'vnt.', 157, 1, '2012-11-29', 0, 0, 0, 0, 0),
