(115616, 2636, '.2470.2571.2572', 'Liemenėlė LBR-574 ruda', 'liemenele lbr-574 ruda', 'Liemenele-LBR-574-ruda', 'Elegantiška, šviesiai rudos spalvos " Push-up" tipo liemenėlė. ', '<P><SPAN style="mso-bidi-font-size: 10.5pt">Elegantiška, šviesiai rudos spalvos "Push-up" tipo liemenėlė. Papuošta kaspinėliu ir nėrinukais. Pasiūta iš lygios medžiagos, todėl tobulai tiks net ir po labai aptemptais drabužiais. Nugaros dalis pasiūta iš tampraus audinio. 2 eilių, 3 padėčių užsegimas. Reguliuojamos petnešėlės gali būti nusegamos. Liemenėlė sutvirtinta metaliniais lankeliais, kaušelių vidinėje pusėje-medvilninis audinys. </P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Tinka visų formų krūtinėms.<o:p></o:p></P></SPAN>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt"></SPAN>&nbsp;</P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 09:46:42', 0, NULL, '250971000083', 'vnt.', 192, 1, '2012-11-29', 0, 0, 0, 0, 0),
(115617, 2636, '.2470.2571.2572', 'Liemenėlė LBR-678', 'liemenele lbr-678', 'Liemenele-LBR-678', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Elegantiška, puošni, puikiai pakelianti krūtinę liemenėlė. Reguliuojamos bei gali būti nusegamos petnešėlės. Vidinėje pusėje medvilninis audinys. Smulkių baltų ir juodų langelių rašto, tarp kaušelių papuošta rožinės spalvos kaspinėliu. Kaušelių krašteliai ir petnešėlės dekoruotos puošnia juostele.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">&nbsp;</P><o:p>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi liemenėlių dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">B70<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">C70<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">A75<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">B75<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">C75<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">D75<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">B80<o:p></o:p></SPAN></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><o:p>