(115635, 2650, '.2470.2571.2584.2586', 'Pižama Penelope', 'pizama penelope', 'Pizama-Penelope', '', '<html><head></head><body><p>Elegantiška, stilinga ir patogi 2 dalių pižama Penelope.</p><p>Palaidinė raudonos spalvos, trumpom rankovėm. Ties krūtine juodos spalvos atlasinis užrišamas kaspinėlis.</p><p>Kelnės 3/4 ilgio atlasinės juodos spalvos.<span mso-bidi-font-size="10.5pt"> </span></p></body></html>', 0, 0, 0, 0, 0, 21, 'Irall', '2012-07-10 16:15:24', 0, NULL, '250974200028', 'vnt.', 300, 1, '2012-11-29', 0, 0, 0, 0, 0),
