(115685, 2651, '.2470.2571.2587', 'Naktinukai Ophelia', 'naktinukai ophelia', 'Naktinukai-Ophelia', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Prabangus, gundantis peniuaras, pasiūtas iš juodo tiulio ir atlaso. Reguliuojamos Petnešėlės.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Puoštas raukinukais ir kaspinėliais. Nugara surišama atlasiniu kaspinu.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Komplekte: <SPAN style="mso-spacerun: yes">&nbsp;</SPAN>stringai.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">&nbsp;</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi&nbsp;<SPAN style="mso-spacerun: yes">&nbsp;</SPAN>dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">S<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Irall', '2012-02-01 14:57:01', 0, NULL, '250975000068', 'vnt.', 238, 1, '2012-11-29', 0, 0, 0, 0, 0),
