(115688, 2651, '.2470.2571.2587', 'Naktiniai Lucrece', 'naktiniai lucrece', 'Naktiniai-Lucrece', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Elegantiški naktiniai, pasiūti iš rudos spalvos blizgios medžiagos. Priekinė dalis dekoruota nėriniais ir žydros spalvos kaspinėliu per vidurį. Maloniai glunda prie kūno.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><SPAN style="TEXT-DECORATION: none"></SPAN></o:p></SPAN></U></B></P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, '', '2013-01-14 11:54:18', 0, NULL, '250975000070', 'vnt.', 387, 0, '2012-11-29', 0, 0, 0, 0, 0),
(115689, 2651, '.2470.2571.2587', 'Naktiniai Mirabelle', 'naktiniai mirabelle', 'Naktiniai-Mirabelle', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Elegantiški naktiniai, su skeltuku, pasiūti iš juodos blizgios medžiagos. Priekinė dalis ir petnešėlės dekoruotos juodos spalvos gėlių nėriniais. Maloniai glunda prie kūno.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><SPAN style="TEXT-DECORATION: none"></SPAN></o:p></SPAN></U></B></P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, '', '2011-12-13 09:13:20', 0, NULL, '250975000071', 'vnt.', 293, 0, '2012-02-01', 0, 0, 0, 0, 0),
(115690, 2651, '.2470.2571.2587', 'Naktiniai NLD-159', 'naktiniai nld-159', 'Naktiniai-NLD-159', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Elegantiški naktiniai 3/4 rankovėmis, pasiūti iš labai minkšto, kokybiško audinio - modalo, labai mieli prie kūno. Rožinės spalvos, rankogaliai bei naktinių apačia dekoruota baltu nėrinėliu.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><o:p>&nbsp;</o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Sudėtis: Modalas - 95%; elastanas - 5%.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"><o:p><SPAN style="TEXT-DECORATION: none"></SPAN></o:p></SPAN></U></B></P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">S<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-02-01 14:59:54', 0, NULL, '250975000072', 'vnt.', 254, 1, '2012-11-29', 0, 0, 0, 0, 0),
(115691, 2536, '.2470.2472', 'Chalatas SZL-041 kreminis', 'chalatas szl-041 kreminis', 'Chalatas-SZL-041-kreminis', '', '<html><head></head><body><p style="text-align:justify;">Klasikinis kreminės spalvos, minkštas ilgas chalatas.Su dailia apykakle, kuri suteikia elegancijos ir puošnumo. Rankovės ilgos, gali būti užraitomos, prisitaikant reikiamą ilgį.Su diržu ir kilpute pakabinti.</p><p style="text-align:justify;"> Pasiūtas iš itin minkšto audinio(tankis 280-300g/m2),turinčio priešgrybelinių, antibakterinių savybių. Ši medžiaga puikiai laiko kūno šilumą ir neleis Jums sušalti vėsias vakarais.</p><p style="text-align:justify;"><span style="font-weight:bold;">Dydžiai:</span></p><p style="margin-bottom:0pt;margin-top:0cm;">S/M (klubų apimtis 82-90 cm)</p><p style="margin-bottom:0pt;margin-top:0cm;">L/XL (klubų apimtis 90-98 cm)</p><p><span mso-bidi-font-size="10.5pt"> </span></p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-23 14:49:23', 0, NULL, '250920000008', 'vnt.', 481, 0, '2012-08-23', 0, 0, 0, 0, 0),
(115692, 2536, '.2470.2472', 'Chalatas SZL-038', 'chalatas szl-038', 'Chalatas-SZL-038', '', '<html><head></head><body><p>Labai minkštas, ilgas moteriškas chalatas, sujuosiamas diržu, su kapišonu.  Apykaklė atverčiama, labai prabangiai ir jaukiai apgaubia kaklą, dekoruota smulkių gėlyčių raštu. Violetinės spalvos.</p><p><b><u><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">Dydžiai</span></u></b><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">:    </span></p><p><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">S/M</span></p><p><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">L/XL</span></p><p><span mso-bidi-font-size="10.5pt"> </span></p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-23 14:52:02', 0, NULL, '250920000009', 'vnt.', 911, 1, '2012-11-29', 0, 0, 0, 0, 0),
