(115742, 2639, '.2470.2571.2573.2575', 'Tanga LP-1455 violetinės', 'tanga lp-1455 violetines', 'Tanga-LP-1455-violetines', '', '<html><head></head><body><p>Gėlėtos moteriškos kelnaitės, papuoštos baltu kaspinėliu. Priekyje atlasinis audinys,nugaroje tiulis.</p><p><span mso-bidi-font-size="10.5pt"> </span></p><span mso-bidi-font-size="10.5pt"><p><span mso-bidi-font-size="10.5pt"><strong>Dydžių lentelė</strong></span></p><p><span mso-bidi-font-size="10.5pt"><img src="http://www.eshop.b-a.lt/komeksimas/images/image/kn_lentele_d.jpg"></span></p></span></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 15:55:27', 0, NULL, '250972200042', 'vnt.', 279, 1, '2012-11-29', 0, 0, 0, 0, 0),
(115744, 2639, '.2470.2571.2573.2575', 'Tanga LP-1324', 'tanga lp-1324', 'Tanga-LP-1324', '', '<html><head></head><body><p>Dailios "Tanga" modelio kelnaitės pasiūtos iš pilkos spalvos audinio, priekyje papuoštos kaspinėliais ir nėrinukais. Kelnaitės turi natūralaus pluošto įsiuvą.</p><p><span mso-bidi-font-size="10.5pt"> </span></p><span mso-bidi-font-size="10.5pt"><p><span mso-bidi-font-size="10.5pt"><strong>Dydžių lentelė</strong></span></p><p><span mso-bidi-font-size="10.5pt"><img src="http://www.eshop.b-a.lt/komeksimas/images/image/kn_lentele_d.jpg"></span></p></span></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 15:54:10', 0, NULL, '250972200043', 'vnt.', 508, 1, '2012-11-29', 0, 0, 0, 0, 0),
(115747, 2651, '.2470.2571.2587', 'Naktiniai Elvire', 'naktiniai elvire', 'Naktiniai-Elvire', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Elegantiški naktiniai maloniai glunda prie kūno. Krūtinės sritis dekoruota gėlėtu siuvinėjimu ir nėrinukais bei atlasiniu kaspinėliu per vidurį. Apačia puošta juodos spalvos tiulio bangelėmis. Petnešėlių ilgis reguliuojamas.<o:p></o:p></P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">S<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN><o:p></o:p></P>', 0, 0, 0, 0, 0, 21, '', '2011-12-13 16:30:50', 0, NULL, '250975000073', 'vnt.', 229, 0, '2012-02-01', 0, 0, 0, 0, 0),
(115764, 2651, '.2470.2571.2587', 'Naktiniai Solange', 'naktiniai solange', 'Naktiniai-Solange', '', '<html><head></head><body><p class="msonormal" style="margin-top:0cm;margin-right:0cm;text-align:justify;margin-bottom:0pt;margin-left:0cm;">Seksual&#363;s naktiniai, maloniai glunda prie k&#363;no. Naktiniai pasi&#363;ti i&#353;&nbsp;ro&#382;in&#279;s spalvos&nbsp;med&#382;iagos, suderintos su juodu siuvin&#279;tu tiuliu. Priekis dekoruotas&nbsp;n&#279;riniais ir blizgiu akmen&#279;liu per vidur&#303;. Petne&#353;&#279;li&#371; ilgis reguliuojamas.</p><p class="msonormal" style="margin-top:0cm;margin-right:0cm;margin-bottom:0pt;margin-left:0cm;"><b><u><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''"><span style="text-decoration:none;">&nbsp;</span></span></u></b></p><p><b><u><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">Galimi dyd&#382;iai</span></u></b><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">:&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''">XL</span></p><p><span mso-bidi-font-size="10.5pt">&nbsp;</span></p></body></html>', 0, 0, 0, 0, 0, 21, '', '2013-01-14 12:20:29', 0, NULL, '250975000074', 'vnt.', 748, 1, '2012-11-29', 0, 0, 0, 0, 0),
(117767, 2639, '.2470.2571.2573.2575', 'Kelnaitės LP-1561', 'kelnaites lp-1561', 'Kelnaites-LP-1561', '', '<html><head></head><body><p>Tai klasikinio modelio raudonos spalvos moteriškos kelnaitės, kurios labai minkštos ir patogios, nes pasiūtos iš medvilnės. Priekyje dekoruota piešiniu - šventiniu kaspinu, o krašteliai gražiai padailinti nėrinėliu.</p><p><span mso-bidi-font-size="10.5pt"> </span></p><span mso-bidi-font-size="10.5pt"><p><span mso-bidi-font-size="10.5pt"><strong>Dydžių lentelė</strong></span></p><p><span mso-bidi-font-size="10.5pt"><img src="http://www.eshop.b-a.lt/komeksimas/images/image/kn_lentele_d.jpg"></span></p></span></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 15:51:54', 0, NULL, '250972200046', 'vnt.', 117, 1, '2012-11-29', 0, 0, 0, 0, 0),
(117770, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-544', 'kelnaites mh-544', 'Kelnaites-MH-544', '', '<html><head></head><body><p>Raudonos, langelių rašto bokseriukų modelio vyriškos kelnaitės, kurios pasiūtos iš kokybiškos "Bio Wash" medvilnės. Malonios prie kūno, patogios, juosmuo papuoštas raudona gumyte su gamintojo "Atlantic" logotipu.</p><p><span mso-bidi-font-size="10.5pt"> </span></p><p><span mso-bidi-font-size="10.5pt"><table border="0" cellspacing="0" cellpadding="0" style="width:450px;"><tr height="21" style="height:15.75pt;"><td colspan="6" class="xl24" height="21" width="450" style="width:338pt;height:15.75pt;"><u>Vyriškų apatinių kelnių dydžių lentelė</u></td></tr><tr height="17" style="height:12.75pt;"><td height="17" style="height:12.75pt;"> </td><td> </td><td> </td><td> </td><td> </td><td> </td></tr><tr height="22" style="height:16.5pt;"><td class="xl22" height="22" style="height:16.5pt;">Dydis EU</td><td class="xl23">44</td><td class="xl23">46</td><td class="xl23">48</td><td class="xl23">50</td><td class="xl23">52</td></tr><tr height="24" style="height:18pt;"><td class="xl22" height="24" style="height:18pt;">Dydis<span> </span></td><td class="xl23">S</td><td class="xl23">M</td><td class="xl23">L</td><td class="xl23">XL</td><td class="xl23">XXL</td></tr><tr height="29" style="height:21.75pt;"><td class="xl22" height="29" style="height:21.75pt;">Juosmens apimtis</td><td class="xl23">74-78</td><td class="xl23">82-88</td><td class="xl23">90-96</td><td class="xl23">98-104</td><td class="xl23">106-112</td></tr><tr height="28" style="height:21pt;"><td class="xl22" height="28" style="height:21pt;">Ūgis</td><td class="xl23">164-170</td><td class="xl23">170-176</td><td class="xl23">176-182</td><td class="xl23">182-188</td><td class="xl23">188-194</td></tr></table></span></p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 11:05:13', 0, NULL, '250972500009', 'vnt.', 181, 1, '2012-11-29', 0, 0, 0, 0, 0),
(117776, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-534', 'kelnaites mh-534', 'Kelnaites-MH-534', '', '<html><head></head><body><p>Juodos spalvos bokseriukų tipo vyriškos kelnaitės, puoštos gražia liepsnojančia širdimi. Puiki dovana išreikšti savo jausmus mylimam žmogui !</p><p><span mso-fareast-language="JA" mso-fareast-font-family="''MS Mincho''"></span><span mso-bidi-font-size="10.5pt"> </span></p><p><span mso-bidi-font-size="10.5pt"><table border="0" cellspacing="0" cellpadding="0" style="width:450px;"><tr height="21" style="height:15.75pt;"><td colspan="6" class="xl24" height="21" width="450" style="width:338pt;height:15.75pt;"><u>Vyriškų apatinių kelnių dydžių lentelė</u></td></tr><tr height="17" style="height:12.75pt;"><td height="17" style="height:12.75pt;"> </td><td> </td><td> </td><td> </td><td> </td><td> </td></tr><tr height="22" style="height:16.5pt;"><td class="xl22" height="22" style="height:16.5pt;">Dydis EU</td><td class="xl23">44</td><td class="xl23">46</td><td class="xl23">48</td><td class="xl23">50</td><td class="xl23">52</td></tr><tr height="24" style="height:18pt;"><td class="xl22" height="24" style="height:18pt;">Dydis<span> </span></td><td class="xl23">S</td><td class="xl23">M</td><td class="xl23">L</td><td class="xl23">XL</td><td class="xl23">XXL</td></tr><tr height="29" style="height:21.75pt;"><td class="xl22" height="29" style="height:21.75pt;">Juosmens apimtis</td><td class="xl23">74-78</td><td class="xl23">82-88</td><td class="xl23">90-96</td><td class="xl23">98-104</td><td class="xl23">106-112</td></tr><tr height="28" style="height:21pt;"><td class="xl22" height="28" style="height:21pt;">Ūgis</td><td class="xl23">164-170</td><td class="xl23">170-176</td><td class="xl23">176-182</td><td class="xl23">182-188</td><td class="xl23">188-194</td></tr></table></span></p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 11:05:35', 0, NULL, '250972500012', 'vnt.', 211, 1, '2012-11-29', 0, 0, 0, 0, 0),
(118239, 2651, '.2470.2571.2587', 'Naktinukai Vanessa', 'naktinukai vanessa', 'Naktinukai-Vanessa', '', '<P>Elegantiški bei&nbsp;puošnūs sodrios raudonos spalvos naktinukai. Priekis papuoštas permatomu tiuliu, iškirptės kraštelis ir petnešėlės dekoruotas juodu nėrinėliu su raudonomis širdelėmis. Po krūtine juoda juostelė susiriša i kaspinėlį.</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">S<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Irall', '2012-02-08 10:16:09', 0, NULL, '250975000075', 'vnt.', 280, 1, '2012-11-29', 0, 0, 0, 0, 0);
INSERT INTO `prekes_main` (`pre_id`, `pgs_id`, `pg_kodas`, `name`, `name2`, `link`, `short_description`, `description`, `maz_kaina`, `int_kaina`, `d1_kaina`, `d2_kaina`, `d3_kaina`, `pvm`, `gamintojas`, `edit_date`, `akcija`, `akc_kaina`, `kodas`, `vnt`, `pop`, `del`, `data_n`, `pristKaina`, `pritTerm`, `yraFoto`, `skirtKain`, `nerTiek`) VALUES
(118246, 2651, '.2470.2571.2587', 'Naktinukai Avril', 'naktinukai avril', 'Naktinukai-Avril', '', '<P>Seksualūs raudonos spalvos naktinukai. Jie maloniai priglunda prie kūno, nes sudėtyje yra natūrali medžiaga - viskozė. Naktinukų šonai yra iškirpti bei dekoruoti juoda juostele, surišama į kaspinėlį. Naktinukų apačia puošta juodų nėrinių juosta.</P>\r\n<P><B><U><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">Galimi dydžiai</SPAN></U></B><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">:&nbsp;&nbsp;&nbsp;&nbsp;<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">S/M<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA"></SPAN></P>\r\n<P><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">L/</SPAN><SPAN style="mso-fareast-font-family: ''MS Mincho''; mso-fareast-language: JA">XL<o:p></o:p></SPAN></P>\r\n<P><SPAN style="mso-bidi-font-size: 10.5pt">Išsirinktą dydį nurodykite prekių krepšelio komentaruose.</SPAN></P><SPAN style="mso-bidi-font-size: 10.5pt">\r\n<P><U>Sudėtis:</U></P>\r\n<P>Viskozė-72,7%</P>\r\n<P>Elastanas-7,1%</P>\r\n<P>Poliamidas-20,2%</P></SPAN>', 0, 0, 0, 0, 0, 21, '', '2012-02-08 10:17:13', 0, NULL, '250975000076', 'vnt.', 376, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121640, 2636, '.2470.2571.2572', 'Liemenėlė LBR-574 juoda', 'liemenele lbr-574 juoda', 'Liemenele-LBR-574-juoda', 'Elegantiška, juodos spalvos " Push-up" tipo liemenėlė. ', '<P><SPAN style="mso-bidi-font-size: 10.5pt">Elegantiška, juodos spalvos " Push-up" tipo liemenėlė. Papuošta kaspinėliu ir nėrinukais. Pasiūta iš lygios medžiagos, todėl tobulai tiks net ir po labai aptemptais drabužiais. Nugaros dalis pasiūta iš tampraus audinio. 2 eilių, 3 padėčių užsegimas. Reguliuojamos petnešėlės gali būti nusegamos. Liemenėlė sutvirtinta metaliniais lankeliais, kaušelių vidinėje pusėje-medvilninis audinys. </P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Tinka visų formų krūtinėms.<o:p></o:p></P></SPAN>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 09:55:54', 0, NULL, '250971000094', 'vnt.', 66, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121645, 2636, '.2470.2571.2572', 'Liemenėlė BBR-053 ruda', 'liemenele bbr-053 ruda', 'Liemenele-BBR-053-ruda', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Elegantiška klasikinė "Push-up" stiliaus ruda liemenėlė. Viduryje dekoruota smulkia gėlyte. Petnešėlės reguliuojamos bei gali būti nusegamos. Kaušelių vidinė pusė medvilninė. 2 eilių ir 3 padėčių užsegimas nugaroje. Rekomenduojama skalbti rankomis.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><o:p>&nbsp;</o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 11:47:10', 0, NULL, '250971000095', 'vnt.', 68, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121646, 2636, '.2470.2571.2572', 'Liemenėlė BBR-053 balta', 'liemenele bbr-053 balta', 'Liemenele-BBR-053-balta', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Elegantiška klasikinė "Push-up" stiliaus&nbsp;balta liemenėlė. Viduryje dekoruota smulkia gėlyte. Petnešėlės reguliuojamos bei gali būti nusegamos. Kaušelių vidinė pusė medvilninė. 2 eilių ir 3 padėčių užsegimas nugaroje. </P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Rekomenduojama skalbti rankomis.<o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 12:45:49', 0, NULL, '250971000096', 'vnt.', 62, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121647, 2636, '.2470.2571.2572', 'Liemenėlė BBR-050 balta', 'liemenele bbr-050 balta', 'Liemenele-BBR-050-balta', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Elegantiška baltos spalvos "Balconette" tipo liemenėlė. Vidinė liemenėlės dalis pasiūta iš medvilnės. Kaušeliai pakietinti, su išimamomis pagalvėlėmis, sutvirtinti metaliniais lankeliais. Šis modelis pasiūtas taip, jog tinka dėvėti ir be petnešėlių (petnešėlės nusegamos). Juosta juosianti nugarą yra labai tvirta su silikoninėmis limpančiomis juostelėmis, šonuose turi įsiūtas vertikalias vielutes. 2&nbsp;eilių ir 3 padėčių užsegimas nugaroje.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Šone yra Atlantic" logotipas.<o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 12:57:56', 0, NULL, '250971000097', 'vnt.', 74, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121648, 2636, '.2470.2571.2572', 'Liemenėlė BBR-051 balta', 'liemenele bbr-051 balta', 'Liemenele-BBR-051-balta', '', '<P style="MARGIN-BOTTOM: 0pt">Elegantiška PUS"H-UP" klasikinė balta liemenėlė su užsegimu priekyje. Liemenėlės nugaros dalis pasiūta iš tampraus audinio. 3 eilių užsegimas nugaroje ir vienas priekyje. Reguliuojamos klasikinės baltos spalvos petnešėlės. Petnešėlės gali būti nusegamos. Liemenėlės kaušelių vidinėje pusėje - medvilninis audinys.<o:p></o:p></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold">R</SPAN></STRONG><SPAN class=font0>ekomenduojama skalbti rankomis.<o:p></o:p></SPAN></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 14:20:54', 0, NULL, '250971000098', 'vnt.', 89, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121649, 2636, '.2470.2571.2572', 'Liemenėlė LBR-663 mėlyna', 'liemenele lbr-663 melyna', 'Liemenele-LBR-663-melyna', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Mėlyna&nbsp; liemenėlė su kūno spalvos taškeliais, nėrinėliu. Per vidurį papuošta atlasiniu kaspinėliu. Medvilninis audinys puoštas kūno spalvos taškeliais. Nugaros dalis medvilninis, 2 eilių ir 3 padėčių užsegimas. Reguliuojamos petnešėlės gali būti nusegamos. Kaušeliai pakietinti, sutvirtinti metaliniais lankeliais. Rekomenduojama skalbti rankomis.<o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 16:21:16', 0, NULL, '250971000099', 'vnt.', 81, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121652, 2636, '.2470.2571.2572', 'Liemenėlė LBR-709 juoda', 'liemenele lbr-709 juoda', 'Liemenele-LBR-709-juoda', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Juodos spalvos liemenėlė, dekoruota smulkiomis juodomis širdelėmis. Kaušeliai lengvai pakietinti, tarp jų žavus kaspinėlis. Viena petnešėlė papuošta trimis juodos spalvos kaspinėliais. Vidinė pusė medvilninė.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Rekomenduojama skalbti rankomis.<o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 14:47:15', 0, NULL, '250971000101', 'vnt.', 76, 1, '2012-11-29', 0, 0, 0, 0, 0),
