(121655, 2636, '.2470.2571.2572', 'Liemenėlė LBR-631 pilka', 'liemenele lbr-631 pilka', 'Liemenele-LBR-631-pilka', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Tamsiai pilkos spalvos "Push-up" stiliaus liemenėlė puikiai pakelia krūtinę. Kaušelių kraštelis apsiūtas baltos spalvos gifiūru, tarp kaušelių akmenėlis. Tai suteikia liemenėlei elegantiškumo. Viduje įdėtos&nbsp;pagalvėlės, kurias&nbsp;galima išimti. &nbsp;Petnešėlės gali būti nusegamos. Viduje medvilnė.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold">R</SPAN></STRONG><SPAN class=font0>ekomenduojama skalbti rankomis.</SPAN><o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-12 15:08:38', 0, NULL, '250971000103', 'vnt.', 85, 1, '2012-11-29', 0, 0, 0, 0, 0),
