(121657, 2636, '.2470.2571.2572', 'Liemenėlė LBR-670 rožinė', 'liemenele lbr-670 rozine', 'Liemenele-LBR-670-rozine', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Neryškios rožinės spalvos "Push-up" stiliaus liemenėlė su smulkiomis juostelėmis. Pasiūta iš medvilnės, viduje&nbsp;įdėtos išimamos pagalvėlės,&nbsp;puikiai prilaiko ir pakelia krūtinę.&nbsp; Petnešėlės nusegamos, reguliuojamos.<STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold"><o:p></o:p></SPAN></STRONG></P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt"><STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold">R</SPAN></STRONG><SPAN class=font0>ekomenduojama skalbti rankomis.</SPAN><o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 16:18:39', 0, NULL, '250971000105', 'vnt.', 67, 1, '2012-11-29', 0, 0, 0, 0, 0),
