(121681, 2639, '.2470.2571.2573.2575', 'Kelnaitės LP-1726', 'kelnaites lp-1726', 'Kelnaites-LP-1726', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Klasikinės kelnaitės. Medvilninės, patogios dėvėti kiekvieną dieną. Juosmuo apsiūtas balta gumyte, papuoštos kaspinėliu.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.<?xml:namespace prefix = o ns = "urn:schemas-microsoft-com:office:office" /><o:p></o:p></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-06-12 00:28:35', 0, NULL, '250972200058', 'vnt.', 77, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121682, 2639, '.2470.2571.2573.2575', 'Kelnaitės LP-1603', 'kelnaites lp-1603', 'Kelnaites-LP-1603', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Baltos spalvos kelnaitės, pasiūtos iš ypač minkštos "Bio Wash" medvilnės, todėl labai patogios kiekvieną dieną. Priekyje pasiuvinėti gėlių ornamentai, juosmens viduryje aukso spalvos pakabukas.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify"><STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold">R</SPAN></STRONG><SPAN class=font0>ekomenduojama skalbti rankomis.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-06-12 00:28:35', 0, NULL, '250972200059', 'vnt.', 73, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121685, 2651, '.2470.2571.2587', 'Naktiniai NLD-157', 'naktiniai nld-157', 'Naktiniai-NLD-157', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify">Naktinukai, pasiūti iš aukštos kokybės audinio - modalo. Naktinukai su petnešėlėmis, iškirptė V formos, po krūtine laisvai krentantys, todėl nevaržo judesių miegant. Iškirptės krašteliai bei naktinukų apačia papuošta gifiūrine juostele.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: justify"><STRONG><SPAN style="FONT-WEIGHT: normal; mso-bidi-font-weight: bold">R</SPAN></STRONG><SPAN class=font0>ekomenduojama skalbti rankomis.</SPAN></P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-04-13 13:35:35', 0, NULL, '250975000077', 'vnt.', 256, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121687, 2650, '.2470.2571.2584.2586', 'Pižama NLP-270', 'pizama nlp-270', 'Pizama-NLP-270', '', '<html><head></head><body><p class="msonormal" style="margin-bottom:0pt;margin-right:0cm;text-align:justify;margin-top:0cm;margin-left:0cm;">Rožinės arba pilkos spalvos su juodomis širdelėmis medvilninė pižama. Palaidinė su petnešėlėmis,  po krūtine sutraukta, yra dvi juodos gifiūro juostelės. Šortukai trumpi, krašteliai apsiūti juoda juostele.<span mso-bidi-font-weight="bold"> </span></p><p class="msonormal" style="margin-bottom:0pt;margin-right:0cm;margin-top:0cm;margin-left:0cm;">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-10 15:58:15', 0, NULL, '250974200032', 'vnt.', 82, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121690, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-520', 'kelnaites mh-520', 'Kelnaites-MH-520', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Juodos spalvos klasikiniai šortukai, pasiūti iš aukštos kokybės bambuko pluošto. Juosmuo pasiūtas iš minkšto audinio - mikrofibros, kuri nesukelia alergijos, leidžia patogiai jaustis. Viršuje "Atlantic" užrašas.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 11:06:49', 0, NULL, '250972500013', 'vnt.', 84, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121696, 2728, '.2470.2571.2573.2664', 'Kelnaitės MP-913', 'kelnaites mp-913', 'Kelnaites-MP-913', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Klasikinės trikampio formos juodos kelnaitės, kurios pagrindą sudaro aukštos kokybės bambukas. Juosmuo pasiūtas iš mikšto mikrofibros audinio, kuri nesukelia alergijos ir leidžia patogiai jaustis. Viršuje Atlantic užrašas.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-03 00:29:11', 0, NULL, '250972500014', 'vnt.', 132, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121697, 2728, '.2470.2571.2573.2664', 'Kelnaitės MP-932', 'kelnaites mp-932', 'Kelnaites-MP-932', '', '<html><head></head><body><p class="msonormal" style="margin-left:0cm;margin-right:0cm;margin-top:0cm;margin-bottom:0pt;">Trikampio formos baltos kelnaitės su žydros, geltonos, mėlynos spalvos dryželiais. Juosmuo medvilninis, papuoštas gamintojo logotipu.</p><p class="msonormal" style="margin-left:0cm;margin-right:0cm;margin-top:0cm;margin-bottom:0pt;">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 13:31:59', 0, NULL, '250972500015', 'vnt.', 114, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121698, 2728, '.2470.2571.2573.2664', 'Kelnaitės MP-519', 'kelnaites mp-519', 'Kelnaites-MP-519', '', '<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Bokseriukų modelio kelnaitės, margintos smulkiais jūros mėlynumo, baltais langeliais. Šone emblema. Pasiūtos iš minkštos, tamprios medvilnės, todėl patogu dėvėti, nevaržo judesių.</P>\r\n<P class=MsoNormal style="MARGIN: 0cm 0cm 0pt">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</P>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-03 00:29:11', 0, NULL, '250972500016', 'vnt.', 128, 1, '2012-11-29', 0, 0, 0, 0, 0),
(121699, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-496', 'kelnaites mh-496', 'Kelnaites-MH-496', '', '<html><head></head><body><p class="msonormal" style="margin-left:0cm;margin-right:0cm;margin-top:0cm;margin-bottom:0pt;">Bokseriukų modelio mėlynos spalvos vyriškos kelnaitės, pasiūtos iš  medvilnės. Vienas šonas papuoštas užrašais, kitas -  gamintojo logotipas.</p><p class="msonormal" style="margin-left:0cm;margin-right:0cm;margin-top:0cm;margin-bottom:0pt;">Galima skalbti skalbimo mašinoje 40 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 11:06:27', 0, NULL, '250972500017', 'vnt.', 73, 1, '2012-11-29', 0, 0, 0, 0, 0),
