(124708, 2636, '.2470.2571.2572', 'Liemenėlė LBR-722', 'liemenele lbr-722', 'Liemenele-LBR-722', '', '<html><head></head><body><p>"Push-up" stiliaus, gėlėmis marginta liemenėlė. Kaušeliai pakietinti, yra išimami medvilniniai įdėkliukai. Kaušelių krašteliai bei nugaroje per apimtį papuošta gifiūrine juostele. Tarp kaušelių - kaspinėlis su metaliniu drugeliu. Petnešėlės reguliuojamos, nenusegamos. Iš vidaus medvilnė. Rekomenduojama plauti rankomis.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-11 15:06:20', 0, NULL, '250971000109', 'vnt.', 62, 1, '2012-11-29', 0, 0, 0, 0, 0),
(124709, 2639, '.2470.2571.2573.2575', 'Kelnaitės LP-1625', 'kelnaites lp-1625', 'Kelnaites-LP-1625', '', '<html><head></head><body><p>Gėlėmis margintos kelnaitės, pasiūtos iš labai minkšto audinio, mielos ptie kūno, patogios. Viršuje kraštelis apsiūtas žalsvos spalvos gifiūru, viduriukas dekoruotas metaliniu drugeliu. Viduje yra medvilninis įsiuvas. Rekomenduojama plauti rankomis.</p><p> </p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-11 15:08:25', 0, NULL, '250972200068', 'vnt.', 62, 1, '2012-11-29', 0, 0, 0, 0, 0),
(124711, 2639, '.2470.2571.2573.2575', 'Kelnaitės LP-1626', 'kelnaites lp-1626', 'Kelnaites-LP-1626', '', '<html><head></head><body><p>Gėlėmis margintos, plonos, klasikinio kirpimo kelnaitės. Užpakaliuko dalyje krašteliai apvesti gifiūro juostele, todėl nėra storos juostelės ir dėvint kelnaičių nesimato. Juosmuo papuoštas metaliniu drugeliu. Viduje medvilninis įsiuvas. Rekomenduojama plauti rankomis.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-07-11 15:09:51', NULL, NULL, '250972200069', 'vnt.', 66, 1, '2012-11-29', 0, 0, 0, 0, 0),
(124981, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-584', 'kelnaites mh-584', 'Kelnaites-MH-584', '', '<html><head></head><body><p>Pilkos spalvos šorukų modelio kelnaitės, pasiūtos iš natūralaus audinio - modalo. Labai minkštos, patogios, malonios prie kūno, plonytės medžiagos, todėl ypač tinka vasarai. Juosmuo su apsiūta guma, todėl nedirgins jautrios odos.</p><p>Rekomenduojama skalbti 30 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-03 00:29:11', 0, NULL, '250972500018', 'vnt.', 79, 1, '2012-11-29', 0, 0, 0, 0, 0),
(124984, 2728, '.2470.2571.2573.2664', 'Kelnaitės MH-513', 'kelnaites mh-513', 'Kelnaites-MH-513', '', '<html><head></head><body><p>Bokseriukų modelio vyriškos kelnaitės, pasiūtos iš medvilnės, dekoruoto juodos, žalios spalvos  linijomis arba juodos, geltonos spalvos  linijomis ir užrašais. Juosmens gumytė apsiūta medvilniniu audiniu ir dekoruota gamintojo logotipu.</p><p>Rekomenduojama skalbti 40 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 11:06:08', 0, NULL, '250972500019', 'vnt.', 97, 1, '2012-11-29', 0, 0, 0, 0, 0),
