(124990, 2728, '.2470.2571.2573.2664', 'Kelnaitės MBX-364', 'kelnaites mbx-364', 'Kelnaites-MBX-364', '', '<html><head></head><body><p>Ilgos vyriškos kelnaitės, pasiūtos iš pilko audinio, dekoruoto plonomis oranžinės, baltos ir juodos spalvos vertikaliomis linijomis. Priekyje yra 2 pilkos sagutės. Pasiūtos iš medvilnės. </p><p>Rekomenduojama skalbti 40 laipsnių temperatūroje.</p></body></html>', 0, 0, 0, 0, 0, 21, 'Atlantic', '2012-08-10 13:32:53', 0, NULL, '250972500022', 'vnt.', 131, 1, '2012-11-29', 0, 0, 0, 0, 0),
